const ReccDetails = ({ recc }) => {
    return (
        <div className="recc-details">
            <h4>{recc.name}</h4>
            <p><strong>ARC Code: </strong>{recc.ARCcode}</p>
            <p><strong>Location: </strong>{recc.location}</p>
            <p><strong>Description: </strong>{recc.description}</p>
            <p><strong>Rec Template: </strong>{recc.template}</p>
            <p><strong>Times Used: </strong>{recc.entries}</p>
            <p>{recc.createdAt}</p>
        </div>
    );
}

export default ReccDetails;
